CREATE TABLE nba_shot_logs (
    `GAME_ID` INT,
    `MONTH` VARCHAR(3) CHARACTER SET utf8,
    `DATE` INT,
    `YEAR` INT,
    `HOME` VARCHAR(3) CHARACTER SET utf8,
    `AWAY` VARCHAR(3) CHARACTER SET utf8,
    `LOCATION` VARCHAR(1) CHARACTER SET utf8,
    `W` VARCHAR(1) CHARACTER SET utf8,
    `FINAL_MARGIN` INT,
    `SHOT_NUMBER` INT,
    `PERIOD` INT,
    `GAME_CLOCK` VARCHAR(5) CHARACTER SET utf8,
    `SHOT_CLOCK` NUMERIC(3, 1),
    `DRIBBLES` INT,
    `TOUCH_TIME` NUMERIC(3, 1),
    `SHOT_DIST` NUMERIC(3, 1),
    `PTS_TYPE` INT,
    `SHOT_RESULT` VARCHAR(6) CHARACTER SET utf8,
    `CLOSEST_DEFENDER` VARCHAR(25) CHARACTER SET utf8,
    `CLOSEST_DEFENDER_PLAYER_ID` INT,
    `CLOSE_DEF_DIST` NUMERIC(3, 1),
    `FGM` INT,
    `PTS` INT,
    `player_name` VARCHAR(24) CHARACTER SET utf8,
    `player_id` INT
);
